import React, { Component } from 'react';
import './App.css';
class App extends Component {
  render() {
    return (
      <div className="App container-fluid">
        <header className="row">
          <h1 className="color-primary">Hello</h1>
        </header>
      </div>
    );
  }
}

export default App;
